pub enum Scope {
    Global {
        fun_idx: u32,
        global_idx: u32,
        symbols: HashMap<String, IndexedSymbol>,
    },
    Function {
        global: usize,
        local_idx: u32,
        symbols: HashMap<String, IndexedSymbol>,
    },
    Block {
        parent: usize,
        symbols: HashMap<String, IndexedSymbol>,
    },
}
